
#include <iostream>
using namespace std;
vector<vector<int>> threeSum(vector<int>& nums) {
        unordered_map<int,int>s;
        set<vector<int>>se;
        vector<vector<int>>ans;
        int n=nums.size();
        for(int i=0;i<n-1;i++)
        {
            for(int j=i+1;j<n;j++)
            {
                int temp=-(nums[i]+nums[j]);
                if(s.count(temp)!=0)
                {
                       int a=max(nums[i],max(nums[j],temp));
                       int b=min(nums[i],min(nums[j],temp));
                       int c=-(a+b);
                       if(se.find({b,c,a})==se.end())
                       {
                           ans.push_back({b,c,a});
                           se.insert({b,c,a});
                       }
                }
                else
                {
                    s[nums[j]]=1;
                }
            }
            s.clear();
        }
        return ans;
    }

